import React from 'react';

const PostsListItem = ({post}) => {
  return (
    <li>
      <div class="card">
        <div class="card-body">
          <blockquote class="mt-2 blockquote mb-0">
            <p>{post.title}</p>
          </blockquote>
        </div>
      </div>
    </li>
  )
}

export default PostsListItem;
